import React, { Component } from "react";
import { connect } from "react-redux";
import {
  Button,
  Container,
  Form,
  Row,
  Col,
  FormGroup,
  Nav,
  NavItem
} from "react-bootstrap";
import "../../css/sidebar.css";

class OwnerSignUp extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isVisible: true
    };
  }

  render() {
    return (
      <div id="wrapper" class="active">
        <div id="sidebar-wrapper">
          <ul id="sidebar_menu" class="sidebar-nav">
            <li class="sidebar-brand">
              <a id="menu-toggle" href="#">
                Menu
                <span
                  id="main_icon"
                  class="glyphicon glyphicon-align-justify"
                ></span>
              </a>
            </li>
          </ul>
          <ul class="sidebar-nav" id="sidebar">
            <li>
              <a>
                Cadastro<span class="sub_icon glyphicon glyphicon-link"></span>
              </a>
            </li>
            <ul class="sidebar-nav" id="sidebar">
              <li>
                <a>
                  link1<span class="sub_icon glyphicon glyphicon-link"></span>
                </a>
              </li>
              <li>
                <a>
                  link2<span class="sub_icon glyphicon glyphicon-link"></span>
                </a>
              </li>
            </ul>
            <li>
              <a>
                Consulta<span class="sub_icon glyphicon glyphicon-link"></span>
              </a>
            </li>
            <li>
              <a>
                Relatorio<span class="sub_icon glyphicon glyphicon-link"></span>
              </a>
            </li>
          </ul>
        </div>
      </div>
    );
  }
}
function mapStoreToProps(state) {
  return state;
}
export default connect(mapStoreToProps)(OwnerSignUp);
